import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Navbar from '../components/Navbar';

const Profile = () => {
  const [profile, setProfile] = useState(null);
  const [error, setError] = useState('');
  const token = localStorage.getItem('token');

  useEffect(() => {
    const fetchProfile = async () => {
      try {
        const res = await axios.get('/api/v1/profile/', {
          headers: { Authorization: `Token ${token}` },
        });
        setProfile(res.data);
      } catch {
        setError('Failed to load profile.');
      }
    };
    fetchProfile();
  }, [token]);

  return (
    <>
      <Navbar />
      <div className="container py-4">
        <h2 className="text-center mb-4" style={{ color: '#4B0082' }}>My Profile</h2>
        {error && <p className="text-danger text-center">{error}</p>}
        {profile && (
          <div className="card shadow-sm mx-auto" style={{ maxWidth: '400px' }}>
            <div className="card-body">
              <h5 className="card-title" style={{ color: '#4B0082' }}>Hello, {profile.username}</h5>
              <p className="card-text"><strong>Email:</strong> {profile.email}</p>
              <p className="card-text"><strong>User ID:</strong> {profile.id}</p>
            </div>
          </div>
        )}
      </div>
    </>
  );
};

export default Profile;
